.pdf-view {
  overflow: auto;
}
.pdf-view.night-mode {
  -webkit-filter: invert(100%);
}
.pdf-view .page-container {
  margin-left: auto;
  margin-right: auto;
  display: block;
}
.pdf-view .page-container:not(:last-child) {
  margin-bottom: 20px;
}
.pdf-view .tex-highlight {
  position: absolute;
  border-radius: 100%;
  box-shadow: 0px 0px 10px 8px red;
  animation: 3s fadeout both;
}
@keyframes fadeout {
  0% {
    box-shadow: 0px 0px 10px 8px red;
  }
  15% {
    box-shadow: 0px 0px 10px 10px red;
  }
  100% {
    box-shadow: none;
  }
}
